import React, { useContext } from "react";

function CompB() {
  const ctx = useContext(null);
  const { Counter, setCounter } = ctx;
  const handleDecrease = () => {
    setCounter(Counter - 10);
  };
  return (
    <div>
      <h4>CompB</h4>
      <button onClick={handleDecrease}>Decrease</button>
    </div>
  );
}

export default CompB;
